import { Component } from '@angular/core';

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

class Product{
  ticketNumber: string;
  passengerName: string;
  sector: string;
  flightNumber: string;
  dateOfTravel: string;
  oneWay = false;
  returnDateOfTravel: string;
  price: number;
  qty = 1;
}
class Invoice{
  customerName: string;
  address: string;
  contactNo: number;
  pnr: string;
  airlines: string;
  invoiceNo: string;
  vatNo: number;
  email: string;

  products: Product[] = [];

  constructor(){
    // Initially one empty product row we will show
    this.products.push(new Product());
  }
}
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  invoice = new Invoice();

  async generatePDF(action = 'open') {
    let docDefinition = {
      pageSize: 'A4',
      background: [
        {
          image: 'data:image/jpeg;base64,',
          width: '600'
        }
      ],
      content: [
        {
          text: 'SUNSHINE TRAVEL AND TOURISM-KSA, Riyadh',
          fontSize: 16,
          alignment: 'center',
          color: '#047886',
          margin: [0, 70, 0, 0]
        },
        {
          text: 'Email: sagarmathacargo@gmail.com',
          fontSize: 10,
          bold: true,
          alignment: 'center',
          color: 'black'
        },
        {
          text: 'Phone: +966565395154, +966582437102',
          fontSize: 10,
          bold: true,
          alignment: 'center',
          color: 'black'
        },
        {
          text: 'CATEGORY OF SERVICE-AIR TRAVEL OFFICE',
          fontSize: 10,
          bold: true,
          alignment: 'center',
          color: 'black'
        },
        {
          text: 'Customer Details',
          style: 'sectionHeader'
        },
        {
          columns: [
            [
              {
                text: this.invoice.customerName,
                bold: true
              },
              {text: `Address: ${this.invoice.address}`},
              {text: `Email: ${this.invoice.email}`},
              {text: `Contact: ${this.invoice.contactNo}`},
              {text: `VAT: ${!!this.invoice?.vatNo ? this.invoice?.vatNo : ''}`},
            ],
            [
              {
                text: `Date: ${new Date().toLocaleDateString()}`,
                alignment: 'right'
              },
              {
                text: `Invoice No. : ${this.invoice.invoiceNo}`,
                alignment: 'right'
              },
              {
                text: `Airlines: ${this.invoice.airlines}`,
                alignment: 'right'
              },
              {
                text: `PNR No.: ${this.invoice.pnr}`,
                alignment: 'right'
              },
              {
                text: `C.R.: 1010757556`,
                alignment: 'right'
              },
              {
                text: `VAT.: 302128660500003`,
                alignment: 'right'
              }
            ]
          ]
        },
        {
          text: 'Ticket Details',
          style: 'sectionHeader'
        },
        {
          table: {
            headerRows: 1,
            widths: ['*', 'auto', 'auto', 'auto', 'auto', 'auto', 'auto',  'auto', 'auto'],
            body: [
              ['Ticket No.', 'Pax Name', 'Sector', 'Flight No.', 'Date of Travel', 'Return Date', 'Quantity', 'Price', 'Amount'],
              ...this.invoice.products.map(p => ([p.ticketNumber, p.passengerName, p.sector, p.flightNumber,
                p.dateOfTravel, p.returnDateOfTravel, p.qty, p.price, (p.price * p.qty).toFixed(2)])),
              [{text: 'Total Amount', colSpan: 8}, {}, {}, {}, {}, {}, {}, {}, this.invoice.products.reduce((sum, p) =>
                  sum + (p.qty * p.price), 0).toFixed(2)]
            ]
          }
        },
        {
          text: '',
          style: 'padding'
        },
        {
          columns: [
            [{
              qr: `${this.getQRBase64()}`,
              fit: 100
            }],
          ]
        },
        {
          text: '',
          style: 'padding'
        },
        {
          columns: [
            [{
              text: 'Note: This is an electronically generated invoice and does not require a physical signature',
              italics: true,
              fit: '50'
            }
            ],
          ]
        },
      ],
      styles: {
        sectionHeader: {
          bold: true,
          decoration: 'underline',
          fontSize: 14,
          margin: [0, 15, 0, 15]
        },
        padding: {
          margin: [0, 0, 0, 15]
        }
      }
    };

    if (action === 'download') {
      pdfMake.createPdf(docDefinition).download();
    } else if (action === 'print') {
      pdfMake.createPdf(docDefinition).print();
    } else {
      pdfMake.createPdf(docDefinition).open();
    }

  }

  addProduct() {
    this.invoice.products.push(new Product());
  }
  getQRBase64() {
    const sellerNameBuf = this.getTLVForValue('01', 'SUNSHINE TRAVEL AND TOURISM-KSA');
    const vatRegistration = this.getTLVForValue('02', '302128660500003');
    const timeStamp = this.getTLVForValue('03', new Date().getTime().toString());
    const invoiceAmount = this.getTLVForValue('04', `${this.invoice.products.reduce((sum, p) =>
                  sum + (p.qty * p.price), 0).toFixed(2)}`);
    const vatAmount = this.getTLVForValue('05', '0 ');
    return btoa((sellerNameBuf.concat(vatRegistration).concat(timeStamp).concat(invoiceAmount).concat(vatAmount))
        .match(/\w{2}/g).map(a => String.fromCharCode(parseInt(a, 16)) ).join(''));
  }

  getTLVForValue(tagNum, tagValue) {
    return tagNum.concat(this.deciToHex(tagValue.length)).concat(this.toHex(tagValue));
  }

  deciToHex(int: number) {
    const hexString = int.toString(16);
    if ( !!hexString && hexString.length < 2 ) {
      return hexString.padStart(2, '0');
    } else {
      return hexString;
    }
  }

  toHex (str) {
    let result = '';
    if ( !!str ) {
      for (let i = 0; i < str.length; i++) {
        result += str.charCodeAt(i).toString(16);
      }
    }
    return result;
  }

  clearDateOfTravel(product: Product) {
    product.oneWay = !product.oneWay;
    if ( product.oneWay) {
      product.returnDateOfTravel = '';
    }
  }
}
